import React from 'react';

const PopUp = ({photoId, photos}) => {

  let img = photos.filter( photo => {
    return photo.id === photoId
  });
  let imgUrl = img.url;
  console.log(img);
  return (
    <div>
      <div className="popup-overlay">
      </div>
      <div className="new-card-component"> <img src={imgUrl} alt={`alt`} /> </div>
    </div>
  );
}

export default PopUp;
